pub enum TargetSessionAttrs {

    /// No special properties are required.
    Any,

    /// The session must allow writes.
    ReadWrite,
}

pub enum SslMode {

    /// Do not use TLS.
    Disable,

    /// Attempt to connect with TLS but allow sessions without.
    Prefer,

    /// Require the use of TLS.
    Require,
}

pub enum ChannelBinding {

    /// Do not use channel binding.
    Disable,

    /// Attempt to use channel binding but allow sessions without.
    Prefer,

    /// Require the use of channel binding.
    Require,
}

pub enum Host {

    /// A TCP hostname.
    Tcp(String),

    /// A path to a directory containing the server's Unix socket.
    ///
    /// This variant is only available on Unix platforms.
    #[cfg(unix)]
    Unix(PathBuf),
}

pub enum Severity {

    /// PANIC
    Panic,

    /// FATAL
    Fatal,

    /// ERROR
    Error,

    /// WARNING
    Warning,

    /// NOTICE
    Notice,

    /// DEBUG
    Debug,

    /// INFO
    Info,

    /// LOG
    Log,
}

pub enum ErrorPosition {

    /// A position in the original query.
    Original(u32),

    /// A position in an internally generated query.
    Internal {
        /// The byte position.
        position: u32,
        /// A query generated by the Postgres server.
        query: String,
    },
}

pub enum IsolationLevel {

    /// Equivalent to `ReadCommitted`.
    ReadUncommitted,

    /// An individual statement in the transaction will see rows committed before it began.
    ReadCommitted,

    /// All statements in the transaction will see the same view of rows committed before the first query in the
    /// transaction.
    RepeatableRead,

    /// The reads and writes in this transaction must be able to be committed as an atomic "unit" with respect to reads
    /// and writes of all other concurrent serializable transactions without interleaving.
    Serializable,
}

pub enum AsyncMessage {

    /// A notice.
    ///
    /// Notices use the same format as errors, but aren't "errors" per-se.
    Notice(DbError),

    /// A notification.
    ///
    /// Connections can subscribe to notifications with the `LISTEN` command.
    Notification(Notification),
}

pub enum SimpleQueryMessage {

    /// A row of data.
    Row(SimpleQueryRow),

    /// A statement in the query has completed.
    ///
    /// The number of rows modified or selected is returned.
    CommandComplete(u64),
}
